import { Route, Router } from "react-router-dom";
import App1 from "./App1";
import App2 from "./App2";

const App = () => {
  return (
    <div>
      <Route>
        <Router path="/" element={<App1 />} />
        <Router path="/app2" element={<App2 />} />
      </Route>
    </div>
  );
};

export default App;
